const math = require('Math');
const createQueue = require('createQueue');
const callInWindow = require('callInWindow');
const makeInteger = require('makeInteger');
const ciw = require('callInWindow');

const onScroll = () => {

  const doc = copy('document');
  const dlp = createQueue('dataLayer');

  const height = math.max(doc.body.scrollHeight, doc.body.offsetHeight, doc.documentElement.clientHeight, doc.documentElement.scrollHeight, doc.documentElement.offsetHeight);
  let cache = [];

  const calcHeight = (h) => {
    return {
      '25%': makeInteger(h * 0.25),
      '50%': makeInteger(h * 0.50),
      '75%': makeInteger(h * 0.75),
      '100%': h -1
    };
  };

  const scrollY = copy('scrollY');
  const innerH = copy('innerHeight');
  const dist = scrollY + innerH;
  const marks = calcHeight(height);

  if(cache.length >= 4){
    return;
  } else {
    let keys = ciw('Object.keys', marks);
    for(let i=0; i<keys.length; i++){
      if(dist === marks[keys[i]]){
        cache.push(keys[i]);
        dlp({
          'event': 'Scroll Distance', 
          'scrollCategory': 'Scroll Depth', 
          'scrollAction': 'Percent:'+ keys[i], 
          'scrollLabel': dist
        });
      }
    }
